def collect_text(node):
    s = ""
    for child_node in node.childNodes:
        if child_node.nodeType == child_node.TEXT_NODE:
            s += child_node.nodeValue.encode('utf-8').strip()+"\n"
        else:
            s += collect_text(child_node)
    return s

def ref_date(date):
	ind = date.index("cja ")
